const express = require('express');
const router = express();

let access = require('./InnerRoutes/access.route');
router.use('/access',access);

let upload = require('./InnerRoutes/uploader.route');
router.use('/upload',upload);

let HomePage = require('./InnerRoutes/homepage/homepage');
router.use('/homepage',HomePage);

let event = require('./InnerRoutes/events/event.route');
router.use('/event',event);

let register = require('./InnerRoutes/register/register.route');
router.use('/register',register);

let helper = require('./InnerRoutes/helper.route');
router.use('/ServerDate',helper);

module.exports = router;